    def treat(self, page, item):
        
        """Process a single page/item."""
        if willstop:
            raise KeyboardInterrupt
        self.current_page = page
        
        #param -b
        titre = page.title()
        if self.param_first is not None:
            if self.param_first in titre:
                self.param_first = None
            else:
                pywikibot.output('Skipping')
                return
                
        item.get()
        pagetext = page.get()
        # on met de côté les tableaux entraîneur et junior
        pagetext = re.sub(r'SquadreGiovanili *=[^{|]*{{', 'SquadreGiovanili = {{Pouet', pagetext)
        pagetext = re.sub(r'Allenatore *=[^{|]*{{', 'Allenatore = {{Pouet', pagetext)
        #pagetext = re.sub(r'SquadreNazionali=[^{]*{{', 'SquadreNazionali = {{Pouet', pagetext)
        if self.param_debug:
            pywikibot.output(
                'self.fields %s' 
                % self.fields)
            pywikibot.log(
                'pagetext : %s' 
                % pagetext)
        templates = textlib.extract_templates_and_params(pagetext)
        if self.param_debug:
            pywikibot.log(
                'templates : %s' 
                % templates)   
        for (template, fielddict) in templates:
            # Clean up template
            try:
                template = pywikibot.Page(page.site, template,
                                          ns=10).title(withNamespace=False)
            except pywikibot.exceptions.InvalidTitle:
                pywikibot.error(
                    "Failed parsing template; '%s' should be the template name."
                    % template)
                continue
            # We found the template we were looking for
            if template in self.templateTitles:
                
                qualif = ""
                stats = ""
                team = ""
                for field, value in fielddict.items():
                    field = field.strip()
                    value = value.strip()
                    value = re.sub(r'<ref.*<\/ref>', '', value)
                    value = re.sub(r'<ref.*\/ *>', '', value)
                    if not field or not value:
                        continue
                    if not field.isdigit():
                        continue
                    if self.param_debug:
                        pywikibot.output(
                            'output1 %s -> %s (%s)' 
                            % (field, value, int(field) % 3))
                    # dans 3 colonnes Le champ précédant la value contient le qualifier et le suivant les stats
                    #if field not in self.fields:
                    if int(field) % 3 == 1:
                        qualif = value
                    if int(field) % 3 == 2:
                        team = value
                    # This field contains something useful for us
                    #else:
                    if int(field) % 3 == 0:
                        stats = value
                        #fieldm = int(field) % 3
                        #claim = pywikibot.Claim(self.repo, self.fields[str(fieldm)])
                        claim = pywikibot.Claim(self.repo, self.fields['2'])
                        
                        if claim.type == 'wikibase-item':
                            # Try to extract a valid page
                            team = re.sub(r'\[\[File:[^]]*\]\]', '', team)
                            team = self.nettoyage_calcio(team)
                            match = re.search(pywikibot.link_regex, team)
                            if not match:
                                pywikibot.output(
                                    '%s field %s value %s is not a '
                                    'wikilink. Skipping.'
                                    % (claim.getID(), field, team))
                                continue
                            link_text = match.group(1)
                            linked_item = self._template_link_target(item, link_text)
                            if not linked_item:
                                continue
                            claim.setTarget(linked_item)
                        elif claim.type == 'string':
                            claim.setTarget(team.strip())
                        elif claim.type == 'commonsMedia':
                            commonssite = pywikibot.Site("commons", "commons")
                            imagelink = pywikibot.Link(team, source=commonssite,
                                                       defaultNamespace=6)
                            image = pywikibot.FilePage(imagelink)
                            if image.isRedirectPage():
                                image = pywikibot.FilePage(image.getRedirectTarget())
                            if not image.exists():
                                pywikibot.output(
                                    '[[%s]] doesn\'t exist so I can\'t link to it'
                                    % (image.title(),))
                                continue
                            claim.setTarget(image)
                        else:
                            pywikibot.output(
                                '%s is not a supported datatype.'
                                % claim.type)
                            continue
                        if self.param_debug:
                            pywikibot.output(
                                '%s field %s value : %s'
                                % (claim.getID(), field, team))
                        #******** extraction des dates
                        if self.param_debug:
                            pywikibot.output('qualif %s'
                                % qualif)
                        dates = ''
                        nb_matchs = ''
                        nb_buts = ''
                        wp_debut = ''
                        wp_fin = ''
                        wp_pret = False
                        qualifier_debut = None
                        qualifier_fin = None
                        qualifier_pret = None
                        qualifier_matchs = None
                        qualifier_buts = None
        
                        qualif = qualif.replace ('–', '-')
                        qualif = qualif.replace ('&ndash;', '-')
                        qualif = qualif.replace ('{{Clr}}', '')
                        #qualif = qualif.replace ('{{prêt}}', '')      
                        qualif = re.sub(r'{{0(\|0+)?}}', '', qualif)
                        qualif = re.sub(r'[a-zA-Zéêû&; \.\[\?\]\{\}\|]', '', qualif)
                        #si pas de tiret, 
                        if (qualif.find('-') == -1): 
                            qualif = qualif + '-' + qualif 
                        dates = qualif.split('-')
                        if dates[0]:
                            wp_debut = dates[0][:4]
                            if wp_debut.isdigit():
                                if len(wp_debut)==4:
                                    qualifier_debut = pywikibot.Claim(self.repo, u'P580', isQualifier=True)
                                    qualifier_debut.setTarget(pywikibot.WbTime(year=wp_debut))
                                    if self.param_debug:
                                        pywikibot.output(' from %s'
                                            % qualifier_debut.getTarget().toTimestr())
                                    
                                    if dates[1]:
                                        wp_fin = dates[1][:4]
                                        if wp_fin.isdigit():
                                            if len(wp_fin)==4:
                                                qualifier_fin = pywikibot.Claim(self.repo, u'P582', isQualifier=True)
                                                qualifier_fin.setTarget(pywikibot.WbTime(year=wp_fin))
                                                if self.param_debug:
                                                    pywikibot.output(' to %s'
                                                        % qualifier_fin.getTarget().toTimestr())
                                            else:
                                                pywikibot.output(color_format(
                                                    '{lightyellow}Error - date fin à 2 chiffres : %s %s'
                                                    % (team, dates[1])))
                                        else:
                                            pywikibot.output(color_format(
                                                '{lightyellow}Error - date fin pas numérique : %s %s'
                                                % (team, dates[1])))
                                else:
                                    pywikibot.output(color_format(
                                        '{lightyellow}Error - date début à 2 chiffres : %s %s'
                                        % (team, dates[0])))
                            else:
                                pywikibot.output(color_format(
                                    '{lightyellow}Error - date début pas numérique : %s %s'
                                    % (team, dates[0])))
                        #******** extraction des stats
                        stats = stats.replace ('–', '-')
                        stats = re.sub(r'[a-zA-Zéêû&; \.\[\?\]\{\}\|]', '', stats)
                        tstats = stats.split('(')
                        if tstats[0]:
                            nb_matchs = tstats[0].strip()
                            if nb_matchs.isdigit():
                                nb_matchs = int(nb_matchs)
                                if nb_matchs > 0:
                                    qualifier_matchs = pywikibot.Claim(self.repo, u'P1350', isQualifier=True)
                                    qualifier_matchs.setTarget(pywikibot.WbQuantity(amount=int(nb_matchs), error=0))                                
                                    if tstats[1]:
                                        nb_buts = tstats[1].strip()
                                        nb_buts = nb_buts.replace ('-', '0').replace (')', '')
                                        if nb_buts.isdigit():
                                            nb = int(nb_buts)
                                            if nb < 0:
                                                nb = 0
                                            qualifier_buts = pywikibot.Claim(self.repo, u'P1351', isQualifier=True)
                                            qualifier_buts.setTarget(pywikibot.WbQuantity(amount=nb, error=0))
                                        else:
                                            pywikibot.output(color_format(
                                                '{lightyellow}Error - buts pas numérique : %s %s'
                                                % (team, nb_buts)))
                                else:
                                    pywikibot.output(color_format(
                                        '{lightyellow}Nb de matchs = 0 - pas pris en compte : %s %s'
                                        % (team, nb_matchs)))
                            else:
                                pywikibot.output(color_format(
                                    '{lightyellow}Error - matchs début pas numérique : %s %s'
                                    % (team, nb_matchs)))
                        if self.param_debug:
                            pywikibot.output('stats %s (%s) OK'
                                % (nb_matchs, nb_buts))
                                
                        #... →           
                        if (team.find('→') > -1): 
                            wp_pret = True
                            qualifier_pret = pywikibot.Claim(self.repo, u'P1642', isQualifier=True)
                            qualifier_pret.setTarget( pywikibot.ItemPage(self.repo, "Q2914547"))
                            if self.param_debug:
                                pywikibot.output('loan OK')
                        #on regarde ce qu'il y a dans le P54
                        skip_claim = False
                        if claim.getID() in item.claims:
                            existing_claims = item.claims[claim.getID()]  # Existing claims on page of same property
                            for existing in existing_claims:
                                # si on retrouve dans WD le club de l'infobox (ça devient intéressant)
                                if claim.getTarget() == existing.getTarget():
                                    # on récupère les qualifiers dans WD
                                    existing580 = None
                                    existing582 = None
                                    existing1642 = None
                                    existing1350 = None
                                    existing1351 = None
                                    qual_added = False
                                    wd_debut = None
                                    wd_fin = None
                                    wd_pret = None
                                    wd_matchs = None
                                    wd_buts = None
                                    for qfield, qvalue in existing.qualifiers.items():
                                        if qfield.strip() == 'P580':
                                            existing580 = qvalue
